  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains measurements from
  CTD hydrocast stationsnfrom seven cruises of NOAA Ship Townsend Cromwell in the
  central northnPacific from 1997 to 2002 sponsored by the National Oceanic andnAtmospheric
  Administration (NOAA) National Marine Fisheries Servicen(NMFS).nnFluorescence and
  oxygen sensors were mounted on the CTDs. Cast depthnvaried between 500 to 1000 m
  and spacing between stations of betweenn15 to 30 nmi. Nutrients are available for
  a few cruises. Specificndetails of each cruise are given in the included cruise
  reports. Datanare in several ASCII text formats and specific file organization andnformats
  vary from cruise to cruise.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
